`;

export const Content = styled.div `
display:flex;
margin: auto;
	width: 100%;
	height: 100%;
	background-color: #3776ab;
	padding-top:8em;
	position:relative;
    .form {
      padding-bottom: 5em;
    }

`;
export const Nav = styled.div `
	flex:1;
